import styled from "styled-components";

export const CalendarContainer = styled.div`
    display: flex;
    width: 80%;
    height: 60%;
    background: #f9f2ed;
`;

export const CalendarWeekContainer = styled.div`
    display: grid;
    grid-template-columns: 1fr 1fr 1fr 1fr 1fr 1fr 1fr;
`;
